import React, {useState, useEffect} from 'react';
import styles from './styles'
import { StyleSheet, Button, View, TextInput, SafeAreaView, TouchableHighlight } from 'react-native';

const HomeRoute = () => <Text>Home</Text>;
const GameWarden = () => <Text>Game Warden</Text>;
const Search = () => <Text>Search</Text>;
const UserAccount = () => <Text>User Account</Text>;

export default function NavBar({navigation, user, gameWarden}) {
    if(!user) {
        throw new Error('User not defined in NavBar');
    }

    const [routes] = React.useState([
      { key: 'Home', title: 'Home', focusedIcon: 'heart', unfocusedIcon: 'heart-outline' },
      { key: 'Game Warden', title: 'Game Warden', focusedIcon: 'heart', unfocusedIcon: 'heart-outline' },
      { key: 'Search', title: 'Search', focusedIcon: 'heart', unfocusedIcon: 'heart-outline' },
      { key: 'User Account', title: 'User Account', focusedIcon: 'heart', unfocusedIcon: 'heart-outline' },
    ]);

    return (
        <TouchableHighlight>
            <View style = {styles.container}>
                <Button title="Home"
                    onPress={() =>
                        navigation.navigate('Home', user={user})
                    }>

                </Button>
                {gameWarden ?
                (<Button title="Game Warden"
                onPress={() =>
                    navigation.navigate('Game Warden', user={user})
                }>
                </Button>):
                (<Button title="Search"
                    onPress={() =>
                        navigation.navigate('Search', user={user})
                    }>
                </Button>)}
                <Button title="User Account"
                    onPress={() =>
                        navigation.navigate('User Account', user={user})
                    }>
                </Button>
            </View>
        </TouchableHighlight>
    )

}
